import React from 'react';
import logoImg from './logo_white.svg'
import { Link } from 'react-router-dom';

const Logo = props => {

  const logoStyles = {
    width: "auto", 
    height: "50px", 
    display: "block"
  }

  return(
    <div className="Logo">
      <Link
        to="/"
        className="Logo__anchor"
        onClick={props.onClick}>

        </Link>
      <a 
        className="Logo__anchor" 
        href="#"
        onClick={props.onClick}>
          <img 
            className="Logo__image"
            alt="Glowspace Logo" 
            style={logoStyles}
            src={logoImg} 
          />
      </a>
    </div>
  )
}

export default Logo;
